import styled from "styled-components";

export const CheckoutContainer=styled.div`
    cursor: defualt;
    align-items: center;
`;

export const CheckoutHeadings=styled.div`
    display: flex;
    justify-content: space-between;
`;

export const CheckoutHeading=styled.span`
    width: 25%;
    text-align: center;
`;

